export default function FilmElement(props) {
  return (
    <div className="filmElement">
      <p>{props.title}</p>
      <img
        src={`https://image.tmdb.org/t/p/original${props.poster}`}
        alt={`${props.title} Poster`}
        className="film-Poster"
      />
    </div>
  );
}
